import { Card, CardContent, Box, Grid, Stack, TextField, Button, Autocomplete, FormControl } from '@mui/material';
import React, { FC } from "react";
import AddIcon from "@mui/icons-material/Add";
import SearchIcon from "@mui/icons-material/Search";
import FileDownloadIcon from "@mui/icons-material/FileDownload";
import AttachFileIcon from "@mui/icons-material/AttachFile";
import AutorenewIcon from '@mui/icons-material/Autorenew';
import { userTabs } from './properties/properties';
import InputUsersFilter from "../../components/filter/users.filter";
import InputDepartmentFilter from "../../components/filter/department.filter";
import InputEmployeeStatusFilter from "../../components/filter/employeeStatus.filter";
import _ from 'lodash';

const workingStatus = userTabs;
const UserFilter: FC<any> = (props) => {
    const [msnv, setMSNV] = React.useState([] as any)
    const [departmentId, setDepartmentId] = React.useState([] as any)
    const [code, setCode] = React.useState("")
    const filterUser = (data: any) => {
        let arr: any[] = [];
        _.map(data, (value) => {
            arr.push(value.msnv);
        });
        setMSNV(arr);
    }
    const filterDepartment = (data: any) => {
        let arr: any[] = [];
        _.map(data, (value) => {
            arr.push(value.id);
        });
        setDepartmentId(arr);
    }
    const handleChange = (e: any) => {
        setCode(e.target.value)
    }
    const handleSearch = () => {
        let data = {
            "msnv": msnv,
            "departmenId": departmentId,
            "user_id": code
        }
        props.onSearch(data);
    }
    return (
        <Card sx={{ m: "1rem", p: "0.5rem" }}>
            <CardContent>
                <Box sx={{ flexGrow: 1 }}>
                    <Grid container spacing={2}>
                        <Grid item xs={6.5}>
                            <Stack direction="row"
                                spacing={2}
                                alignItems="center">
                                <FormControl fullWidth>
                                    <TextField
                                        name="user_id"
                                        size="small"
                                        onChange={handleChange}
                                        value={code}
                                        label="Mã nhân viên"
                                    />
                                </FormControl>
                                <FormControl fullWidth>
                                    <InputUsersFilter title={"Tất cả nhân viên"} multiple={true}
                                        onChange={filterUser} />
                                </FormControl>
                                <FormControl fullWidth>
                                    <InputDepartmentFilter title={"Tất cả phòng ban"} multiple={true}
                                        onChange={filterDepartment} />
                                </FormControl>

                            </Stack>
                        </Grid>
                        <Grid item xs={5.5}>
                            <Stack
                                direction="row"
                                justifyContent="flex-start"
                                alignItems="flex-start"
                                spacing={2}
                            >
                                <Button
                                    sx={{ fontWeight: "600" }}
                                    variant="contained"
                                    onClick={handleSearch}
                                >
                                    <SearchIcon />
                                    Tìm kiếm
                                </Button>
                                <Button
                                    sx={{ fontWeight: "600" }}
                                    variant="contained"
                                    onClick={props?.onCreate}
                                >
                                    <AddIcon />
                                    Thêm mới
                                </Button>
                                <Button
                                    sx={{ fontWeight: "600" }}
                                    variant="contained"
                                    onClick={props?.onRefresh}
                                >
                                    <AutorenewIcon />
                                    Làm mới
                                </Button>

                            </Stack>
                            <Stack
                                spacing={2} direction="row"
                                justifyContent="flex-start"
                                alignItems="flex-start"
                                mt={2}
                            >
                                <Button
                                    sx={{ fontWeight: "600" }}
                                    variant="contained"
                                    onClick={props?.onExport}
                                >
                                    <FileDownloadIcon />
                                    Xuất Excel
                                </Button>
                                <Button
                                    sx={{ fontWeight: "600" }}
                                    variant="contained"
                                    onClick={props?.onImport}
                                >
                                    <AttachFileIcon />
                                    Import
                                </Button>
                            </Stack>
                        </Grid>
                    </Grid>
                </Box>
            </CardContent>
        </Card>
    );
};

export default UserFilter;
